console.log("Deliverability > Running");var DELIVERABILITY=DELIVERABILITY||{};DELIVERABILITY.login=function(){console.log("Deliverability > Login: App");$("#email")[0].value="marketolive@marketo.com";$("#password")[0].value="!Marketo17";$("button")[0].click();}
DELIVERABILITY.removeSettingsMenu=function(){console.log("Deliverability > Removing: Settings Menu");$(".dropdown").each(function(){$(this).remove();});}
DELIVERABILITY.removeCreateTestButton=function(){console.log("Deliverability > Removing: Create Test Button");$("#tour-design-add-anchor").remove();}
DELIVERABILITY.removeInboxDeleteButton=function(){console.log("Deliverability > Removing: Inbox Delete Button");$("#btndelete").remove();}
DELIVERABILITY.removeGenericButton=function(buttons,property,target){if(buttons.length==0){console.log("Deliverability > Error: removeGenericButton() received an empty selector.");return;}
for(var ii=0;ii<buttons.length;++ii){if($(buttons[ii]).attr(property)==null){continue;}
else if($(buttons[ii]).attr(property).search(target)!=-1){$(buttons[ii]).remove();}}}
DELIVERABILITY.removeInboxDrillDownDeleteButtons=function(){console.log("Deliverability > Removing: Campaign Delete Buttons");DELIVERABILITY.removeGenericButton($("button"),"value","delete");}
DELIVERABILITY.removeDesignDeleteButton=function(){console.log("Deliverability > Removing: Design Delete Button");DELIVERABILITY.removeGenericButton($(".btn.btn-default.pull-right.vertspacerx2.spacerx2"),"href","action=delete");}
DELIVERABILITY.removeManageProfilesButton=function(){console.log("Deliverability > Removing: Manage Profiles Button");DELIVERABILITY.removeGenericButton($(".btn.btn-sm.btn-success.vertspacerx2.spacer"),"href","/app/inbox-informant/profiles");}
DELIVERABILITY.removeReportSaveButton=function(){console.log("Deliverability > Removing: Run and Save Button");DELIVERABILITY.removeGenericButton($(".btn.btn-success"),"value","Run and Save");}
currentUrl=window.location.href;DELIVERABILITY.removeSettingsMenu();if(currentUrl.search("^https:\/\/250ok.com\/login$")!=-1){DELIVERABILITY.login();}
else if(currentUrl.search("\/app\/design-informant$")!=-1){DELIVERABILITY.removeCreateTestButton();}
else if(currentUrl.search("\/app\/design-informant\/[0-9a-zA-Z]+$")!=-1){DELIVERABILITY.removeDesignDeleteButton();}
else if(currentUrl.search("\/app\/inbox-informant$")!=-1){DELIVERABILITY.removeInboxDeleteButton();DELIVERABILITY.removeManageProfilesButton();}
else if(currentUrl.search("app\/inbox-informant\/campaign\/[0-9a-zA-Z]+$")!=-1){DELIVERABILITY.removeInboxDrillDownDeleteButtons();}
else if(currentUrl.search("\/app\/reports\/report\/custom\/build$")!=-1){DELIVERABILITY.removeReportSaveButton();}